import React from "react";
import styled from "styled-components";
const UL = styled.ul`
    margin: 0;
    padding: 0;
    background-color: ${(props) => (props.isPractice ? "#692692" : "#405cc1")};
    color: white;
    margin: 15px;
    padding: 10px;
    box-shadow: 0px 0px 30px 0px rgba(0, 0, 0, 0.3);
`;
const P = styled.p`
    font-size: 1.2em;
    margin: 5px 0px;
    font-weight: 700;
`;
const List = ({ isPractice, day, children }) => {
    return (
        <UL isPractice={isPractice}>
            <P>{day}</P>
            {children}
        </UL>
    );
};

export default List;
